function Contact() {
  return (
    <section id="contact" className="section">
      <h2>Contact Me</h2>
      <p>Email: <a href="mailto:your-owoyeleabraham@gmail.com">your-email@example.com</a></p>
      <p>GitHub: <a href="https://github.com/">github.com/your-username</a></p>
      <p>LinkedIn: <a href="https://linkedin.com/in/your-profile">linkedin.com/in/your-profile</a></p>
    </section>
  );
}
export default Contact;
